trailingComments.value:
*
 * 复制至剪贴板
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<Object>}
 *
 * @example
 * const params = {
 *   text: '233333',
 * };
 * libSQ.exec('copy', {
 *   params,
 * }).then((info) => {
 *   alert(`[copy][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[copy][error] ${JSON.stringify(err, null, 2)}`);
 * });

